// // src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import RegisterForm from './components/RegisterForm';
import Dashboard from './components/Dashboard';


import './App.css';
import Sbsl from './Assets/Sbsl.png';


const App = () => {
  const buttonStyle = {
    backgroundColor: '#be800d',
    color: '#000000',
    border: '1px solid rgb(0, 0, 0)',
    padding: '10px 20px',
    textDecoration: 'none',
    borderRadius: '50px',
    cursor: 'pointer',
    display: 'block',
    margin: '0 auto', // Center the button horizontally
  };

  return (
    <Router> 
      <div className="container">
        <nav>
            <div class = "title"> E-BILLING APP </div> 
              <a href="/register">Register</a>
              <a href="/dashboard">Dashboard</a>
              <button className = "nav-buttons"> <a href="/register" > LOG IN </a></button>  
        </nav>   


        <div>
        <header className="App-header">
          <img src={Sbsl} alt="Sbsl.png" />          
            <button className="App-register-button" a href="/register" style={buttonStyle}>REGISTER HERE</button>
        </header>
      </div>
         
        <Routes>
          <Route path="/register" element={<RegisterForm />} /> 
          <Route path="/dashboard" element={<Dashboard />} />
        </Routes>

      </div>

      <footer>
          <p>Copyright &#169; 2024 E-BILLING APP. All Rights Reserved.</p>
      </footer>
    </Router>
  );
};

export default App;
